package com.tw.biblioteca;

public class InvalidMenuItem implements MenuItem{

    String errorMessage;
    ConsoleOutput consoleOutput;
    InvalidMenuItem() {

        this.errorMessage = "Select a valid option!";
        consoleOutput = new ConsoleOutput(errorMessage);
    }

    public void execute() {

        System.out.println(errorMessage);
    }

}

package com.tw.biblioteca;

public class Application {
    public static void main(String[] args) {
        Application application = new Application();
        application.start();
    }

    private void start() {
        ConsoleOutput consoleOutput = new ConsoleOutput("Welcome to Biblioteca");
        consoleOutput.displayMessage();

        while(true) {
            Menu menu = new Menu();
            consoleOutput = new ConsoleOutput(menu.toString());
            consoleOutput.displayMessage();

            ConsoleInput consoleInput = new ConsoleInput();
            Parser parser = new Parser(consoleInput.getInput());
            MenuItem menuItem = parser.createMenuItem();
            menuItem.execute();
        }
    }
}

//contains a menu list that can be displayed

package com.tw.biblioteca;

import java.util.ArrayList;

public class Menu {
    ArrayList<String> menu= new ArrayList<String>();
    Menu() {
        menu.add("1. List Books");
        menu.add("2. CheckoutBook");
        menu.add("3. Exit");
    }

    @Override
    public String toString() {
        StringBuilder stringBuilder = new StringBuilder();
        stringBuilder.append("Menu\n");
        for(String menuItem : menu){
            stringBuilder.append(menuItem+"\n");
        }
        return stringBuilder.toString();
    }
}

