//Checks out a book from the library

package com.tw.biblioteca;

public class Checkout implements MenuItem{

    String bookNameChoice;
    Library library;
    ConsoleOutput consoleOutput;
    ConsoleInput consoleInput;
    Book book;


    Checkout(Library library) {
        this.library = library;
        consoleInput = new ConsoleInput();
    }

    public String acceptBookChoice(ConsoleInput consoleInput) {
        return consoleInput.getInput();
    }

    @Override
    public void execute() {
        bookNameChoice = acceptBookChoice(consoleInput);
        book = new Book(bookNameChoice, "author", 0);
        if(hasBeenCheckedOut(book)) {
            consoleOutput = new ConsoleOutput("Thank You! Enjoy the book.");
            consoleOutput.displayMessage();
            System.out.print(library.toString());
        }
        else {
            consoleOutput = new ConsoleOutput("That book is not available");
            consoleOutput.displayMessage();

        }
    }

    public boolean hasBeenCheckedOut(Book book) {
        return library.removeBook(book);
    }
}

//Contains book details in a certain format

package com.tw.biblioteca;

public class Book {
    private String name, author;
    private int yearOfPublication;

    public Book(String name, String author, int yearOfPublication) {
        this.name = name;
        this.author = author;
        this. yearOfPublication = yearOfPublication;
    }

    @Override
    public String toString() {

        return (name+"\t"+author+"\t"+yearOfPublication);
    }

    @Override
    public boolean equals(Object that) {
        if(that == null || that.getClass() != Book.class ) {
            return false;
        }
        Book thatBook = (Book)that;
        if((this.name).equals(thatBook.name)){
            return true;
        }
        return false;
    }

    @Override
    public int hashCode() {
        int hash = 0;
        if(this != null) {
            for (int i = 0; i < name.length(); i++) {
                hash = Character.getNumericValue(name.charAt(i)) + (hash << 6) + (hash << 16) - hash;
            }
        }
        return hash;

    }
}

//Parses the menu option entered by the user and performs operations on the library

package com.tw.biblioteca;

public class Parser {
    private String option;
    private Library library;

    public Parser(String option) {
        this.library = new Library();
        this.option = option;
    }

    public boolean isValid() {
        if(option.matches("[0-9]+") && convertOptionToInt() > 0 && convertOptionToInt() <= 3 ) {
            return true;
        }
        return false;
    }

    private int convertOptionToInt() {
        return Integer.parseInt(option);
    }

    public MenuItem createMenuItem() {
        if(isValid()) {
            if (convertOptionToInt() == 1) {
                return new ListBooks(library);
            }
            else if (convertOptionToInt() == 2) {
                return new Checkout(library);
            }
            else if(convertOptionToInt() == 3) {
                return new Exit();
            }
        }
        return new InvalidMenuItem();
    }
}

